import React from "react";

export default function Sidebar({ setActivePage }) {
  return (
    <aside className="sidebar">
      <h2>Municipal Dashboard</h2>

      <nav>
        <a onClick={() => setActivePage("map")}>Map</a>

        {/* UI text changed only */}
        <a onClick={() => setActivePage("complaints")}>Reports</a>

        <a onClick={() => setActivePage("analytics")}>Analytics</a>
        <a onClick={() => setActivePage("staff")}>Staff</a>
        <a onClick={() => setActivePage("settings")}>Settings</a>
      </nav>
    </aside>
  );
}
